軽自動車にフィット！カーシートカバー　[ReFit]　リ・フィット　左右独立型・2枚セット
<br>
<p><img src="http://image.rakuten.co.jp/i-office1/cabinet/cam/dibiki.gif" alt="代金引換不可商品" border="0" ></p>
<p class="deliv_fee">送料：Aタイプ</p>
<p class="deliv_fee_hoku">北海道への配送は別途送料がかかります。<br>北海道送料：【北1】タイプ</p>
<p style="font-size: 12px; color:#CC0000;">※沖縄、離島へのお届けは別途送料がかかります。</p><br>
●素材<br>
ポリエステル95%、ポリウレタン5%<br>
<br>
●生産国<br>
中国製<br>
<br>
●備考<br>
※シートにシートベルトが直接ついているタイプ・エアバッグがシートに内蔵しているタイプ以外の軽自動車シートに合わせられます。<br>
