G&apos;BASE 新型 コペン LA400K カーボンルックラゲッジマット 
<br /> コペン LA400K専用マットの登場です。 
<br /> カーボンルックのラゲッジマットになります。 
<br /> スポーティーなカーボンルックレーザーを使用したラゲッジマット。 
<br /> スポーティーなコペンをより一層スポーティーに。 
<br /> ステッチをレッドにすることにより、スタイリッシュ感がアップ 
<br /> 
<br /> 見た目が良くなるだけでなく、ラゲッジルームの保護にも効果的。 
<br /> ロードノイズや排気音などのこもり音を低減する効果もあります。 
<br /> 
<br /> 【カラー】カーボンルックレザー／レッドステッチ 
<br /> 【仕様】　裏面滑り止め素材使用 
<br /><style>

