純正のインテリアイメージをくずさずに、自分らしさを愛車に加えたい！<br>
G'BASEオリジナルシートカバーは、そんなあなたのイメージにぴったりのシートカバーです。<br>
よくある安物のシートカバーは、装着すると愛車のインテリアを損なってしまった…<br>
使っているとすぐにぼろぼろになった…<br>
すぐに買い換えないといけなくなり、かえって高くついた…<br>
取り付けが非常に面倒だったetc…そんな経験はございませんでしょうか？？<br>
こちらの商品は低価格ですが、そんな方にピッタリの高級感のあるシートカバーとなっております。<br>
<br>
シンプルなデザインでありながら、太めのサイドデザインライン。<br>
別色生地を使用することで、インテリアのワンポイントになっております。<br>
センター部分にはパンチングレザーを使用することで通気性の良い快適な座り心地を実現。<br>
パンチングラインのシートカバーで、低価格の物はなかなかございません。<br>
<br>
スマートフォンなどをすぐに出し入れできるポケットを、サイドに用意。<br>
シート背面に配した大型ポケットは、収納物を座ったままでも簡単に出し入れできる設計。<br>
書類や雑誌等を入れることができるので、収納スペースを確保できますね<br>
見た目だけでなく、機能面、収納面も兼ね備えた、実用的なシートカバーとなります。<br>
<br>
G'BASEオリジナルシートカバー<br>
こちらの当商品は、イレブンインターナショナルとの共同開発商品です。<br>
<br> 
適合車種：ダイハツ　コペン　LA400K<br>
カラー：ブラウン×アイボリー<br>
<br>
